                    heading:
                        '\u0423 \u043D\u0430\u0441 \u0435\u0441\u0442\u044C \u043F\u0440\u044F\u043C\u0430\u044F \u0438\u043D\u0442\u0435\u0433\u0440\u0430\u0446\u0438\u044F \u0441 \u0432\u0430\u0448\u0438\u043C \u044D\u043C\u0438\u0442\u0435\u043D\u0442\u043E\u043C \u043A\u0430\u0440\u0442\u044B \u0438 \u043C\u044B \u043C\u043E\u0436\u0435\u043C \u0431\u044B\u0441\u0442\u0440\u043E \u0438 \u0442\u043E\u0447\u043D\u043E \u0438\u043C\u043F\u043E\u0440\u0442\u0438\u0440\u043E\u0432\u0430\u0442\u044C \u0434\u0430\u043D\u043D\u044B\u0435 \u043E \u0432\u0430\u0448\u0438\u0445 \u0442\u0440\u0430\u043D\u0437\u0430\u043A\u0446\u0438\u044F\u0445 \u0432 Expensify.\n\n\u0427\u0442\u043E\u0431\u044B \u043D\u0430\u0447\u0430\u0442\u044C, \u043F\u0440\u043E\u0441\u0442\u043E:',
